-- | Contains the content of a message
data MessageContent
  = -- | A text message 
  MessageText
    { -- | Text of the message 
      text_2 :: FormattedText,
      -- | A preview of the web page that's mentioned in the text; may be null
      web_page :: WebPage
    }
  | -- | An animation message (GIF-style). 
  MessageAnimation
    { -- | The animation description 
      animation :: Animation,
      -- | Animation caption 
      caption :: FormattedText,
      -- | True, if the animation thumbnail must be blurred and the animation must be shown only while tapped
      is_secret :: Bool
    }
  | -- | An audio message 
  MessageAudio
    { -- | The audio description 
      audio :: Audio,
      -- | Audio caption
      caption :: FormattedText
    }
  | -- | A document message (general file) 
  MessageDocument
    { -- | The document description 
      document :: Document,
      -- | Document caption
      caption :: FormattedText
    }
  | -- | A photo message 
  MessagePhoto
    { -- | The photo description 
      photo :: Photo,
      -- | Photo caption 
      caption :: FormattedText,
      -- | True, if the photo must be blurred and must be shown only while tapped
      is_secret :: Bool
    }
  | -- | An expired photo message (self-destructed after TTL has elapsed)
  MessageExpiredPhoto
    { 
    }
  | -- | A sticker message 
  MessageSticker
    { -- | The sticker description
      sticker :: Sticker
    }
  | -- | A video message 
  MessageVideo
    { -- | The video description 
      video :: Video,
      -- | Video caption 
      caption :: FormattedText,
      -- | True, if the video thumbnail must be blurred and the video must be shown only while tapped
      is_secret :: Bool
    }
  | -- | An expired video message (self-destructed after TTL has elapsed)
  MessageExpiredVideo
    { 
    }
  | -- | A video note message 
  MessageVideoNote
    { -- | The video note description 
      video_note :: VideoNote,
      -- | True, if at least one of the recipients has viewed the video note 
      is_viewed :: Bool,
      -- | True, if the video note thumbnail must be blurred and the video note must be shown only while tapped
      is_secret :: Bool
    }
  | -- | A voice note message 
  MessageVoiceNote
    { -- | The voice note description 
      voice_note :: VoiceNote,
      -- | Voice note caption 
      caption :: FormattedText,
      -- | True, if at least one of the recipients has listened to the voice note
      is_listened :: Bool
    }
  | -- | A message with a location 
  MessageLocation
    { -- | The location description 
      location :: Location,
      -- | Time relative to the message sent date until which the location can be updated, in seconds
      live_period :: I32,
      -- | Left time for which the location can be updated, in seconds. updateMessageContent is not sent when this field changes
      expires_in :: I32
    }
  | -- | A message with information about a venue 
  MessageVenue
    { -- | The venue description
      venue :: Venue
    }
  | -- | A message with a user contact 
  MessageContact
    { -- | The contact description
      contact :: Contact
    }
  | -- | A dice message. The dice value is randomly generated by the server
  MessageDice
    { -- | The animated sticker with the initial dice animation; may be null if unknown. updateMessageContent will be sent when the sticker became known
      initial_state_sticker :: Sticker,
      -- | The animated sticker with the final dice animation; may be null if unknown. updateMessageContent will be sent when the sticker became known
      final_state_sticker :: Sticker,
      -- | Emoji on which the dice throw animation is based
      emoji :: T,
      -- | The dice value. If the value is 0, the dice don't have final state yet
      value :: I32,
      -- | Number of frame after which a success animation like a shower of confetti needs to be shown on updateMessageSendSucceeded
      success_animation_frame_number :: I32
    }
  | -- | A message with a game 
  MessageGame
    { -- | The game description
      game :: Game
