-- | Contains notifications about data changes
data Update
  = -- | The user authorization state has changed 
  UpdateAuthorizationState
    { -- | New authorization state
      authorization_state :: AuthorizationState
    }
  | -- | A new message was received; can also be an outgoing message 
  UpdateNewMessage
    { -- | The new message
      message :: Message
    }
  | -- | A request to send a message has reached the Telegram server. This doesn't mean that the message will be sent successfully or even that the send message request will be processed. This update will be sent only if the option "use_quick_ack" is set to true. This update may be sent multiple times for the same message
  UpdateMessageSendAcknowledged
    { -- | The chat identifier of the sent message 
      chat_id :: I53,
      -- | A temporary message identifier
      message_id :: I53
    }
  | -- | A message has been successfully sent 
  UpdateMessageSendSucceeded
    { -- | Information about the sent message. Usually only the message identifier, date, and content are changed, but almost all other fields can also change 
      message :: Message,
      -- | The previous temporary message identifier
      old_message_id :: I53
    }
  | -- | A message failed to send. Be aware that some messages being sent can be irrecoverably deleted, in which case updateDeleteMessages will be received instead of this update
  UpdateMessageSendFailed
    { -- | Contains information about the message which failed to send 
      message :: Message,
      -- | The previous temporary message identifier 
      old_message_id :: I53,
      -- | An error code 
      error_code :: I32,
      -- | Error message
      error_message :: T
    }
  | -- | The message content has changed 
  UpdateMessageContent
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Message identifier 
      message_id :: I53,
      -- | New message content
      new_content :: MessageContent
    }
  | -- | A message was edited. Changes in the message content will come in a separate updateMessageContent 
  UpdateMessageEdited
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Message identifier 
      message_id :: I53,
      -- | Point in time (Unix timestamp) when the message was edited 
      edit_date :: I32,
      -- | New message reply markup; may be null
      reply_markup :: ReplyMarkup
    }
  | -- | The view count of the message has changed 
  UpdateMessageViews
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Message identifier 
      message_id :: I53,
      -- | New value of the view count
      views :: I32
    }
  | -- | The message content was opened. Updates voice note messages to "listened", video note messages to "viewed" and starts the TTL timer for self-destructing messages 
  UpdateMessageContentOpened
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Message identifier
      message_id :: I53
    }
  | -- | A message with an unread mention was read 
  UpdateMessageMentionRead
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Message identifier 
      message_id :: I53,
      -- | The new number of unread mention messages left in the chat
      unread_mention_count :: I32
    }
  | -- | A message with a live location was viewed. When the update is received, the client is supposed to update the live location
  UpdateMessageLiveLocationViewed
    { -- | Identifier of the chat with the live location message 
      chat_id :: I53,
      -- | Identifier of the message with live location
      message_id :: I53
    }
  | -- | A new chat has been loaded/created. This update is guaranteed to come before the chat identifier is returned to the client. The chat field changes will be reported through separate updates 
  UpdateNewChat
    { -- | The chat
      chat :: Chat
    }
  | -- | The list to which the chat belongs was changed. This update is guaranteed to be sent only when chat.order == 0 and the current or the new chat list is null 
  UpdateChatChatList
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new chat's chat list; may be null
      chat_list :: ChatList
    }
  | -- | The title of a chat was changed 
  UpdateChatTitle
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new chat title
      title :: T
    }
  | -- | A chat photo was changed 
  UpdateChatPhoto
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new chat photo; may be null
      photo :: ChatPhoto
    }
  | -- | Chat permissions was changed 
  UpdateChatPermissions
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new chat permissions
      permissions :: ChatPermissions
    }
  | -- | The last message of a chat was changed. If last_message is null, then the last message in the chat became unknown. Some new unknown messages might be added to the chat in this case 
  UpdateChatLastMessage
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new last message in the chat; may be null 
      last_message :: Message,
      -- | New value of the chat order
      order :: I64
    }
  | -- | The order of the chat in the chat list has changed. Instead of this update updateChatLastMessage, updateChatIsPinned, updateChatDraftMessage, or updateChatSource might be sent 
  UpdateChatOrder
    { -- | Chat identifier 
      chat_id :: I53,
      -- | New value of the order
      order :: I64
    }
  | -- | A chat was pinned or unpinned 
  UpdateChatIsPinned
    { -- | Chat identifier 
      chat_id :: I53,
      -- | New value of is_pinned 
      is_pinned :: Bool,
      -- | New value of the chat order
      order :: I64
    }
  | -- | A chat was marked as unread or was read 
  UpdateChatIsMarkedAsUnread
    { -- | Chat identifier 
      chat_id :: I53,
      -- | New value of is_marked_as_unread
      is_marked_as_unread :: Bool
    }
  | -- | A chat's source in the chat list has changed 
  UpdateChatSource
    { -- | Chat identifier 
      chat_id :: I53,
      -- | New chat's source; may be null 
      source :: ChatSource,
      -- | New value of chat order
      order :: I64
    }
  | -- | A chat's has_scheduled_messages field has changed 
  UpdateChatHasScheduledMessages
    { -- | Chat identifier 
      chat_id :: I53,
      -- | New value of has_scheduled_messages
      has_scheduled_messages :: Bool
    }
  | -- | The value of the default disable_notification parameter, used when a message is sent to the chat, was changed 
  UpdateChatDefaultDisableNotification
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new default_disable_notification value
      default_disable_notification :: Bool
    }
  | -- | Incoming messages were read or number of unread messages has been changed 
  UpdateChatReadInbox
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Identifier of the last read incoming message 
      last_read_inbox_message_id :: I53,
      -- | The number of unread messages left in the chat
      unread_count :: I32
    }
  | -- | Outgoing messages were read 
  UpdateChatReadOutbox
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Identifier of last read outgoing message
      last_read_outbox_message_id :: I53
    }
  | -- | The chat unread_mention_count has changed 
  UpdateChatUnreadMentionCount
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The number of unread mention messages left in the chat
      unread_mention_count :: I32
    }
  | -- | Notification settings for a chat were changed 
  UpdateChatNotificationSettings
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new notification settings
      notification_settings_2 :: ChatNotificationSettings
    }
  | -- | Notification settings for some type of chats were updated 
  UpdateScopeNotificationSettings
    { -- | Types of chats for which notification settings were updated 
      scope :: NotificationSettingsScope,
      -- | The new notification settings
      notification_settings :: ScopeNotificationSettings
    }
  | -- | The chat action bar was changed 
  UpdateChatActionBar
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new value of the action bar; may be null
      action_bar :: ChatActionBar
    }
  | -- | The chat pinned message was changed 
  UpdateChatPinnedMessage
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new identifier of the pinned message; 0 if there is no pinned message in the chat
      pinned_message_id :: I53
    }
  | -- | The default chat reply markup was changed. Can occur because new messages with reply markup were received or because an old reply markup was hidden by the user
  UpdateChatReplyMarkup
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Identifier of the message from which reply markup needs to be used; 0 if there is no default custom reply markup in the chat
      reply_markup_message_id :: I53
    }
  | -- | A chat draft has changed. Be aware that the update may come in the currently opened chat but with old content of the draft. If the user has changed the content of the draft, this update shouldn't be applied 
  UpdateChatDraftMessage
    { -- | Chat identifier 
      chat_id :: I53,
      -- | The new draft message; may be null 
      draft_message :: DraftMessage,
      -- | New value of the chat order
      order :: I64
    }
  | -- | The number of online group members has changed. This update with non-zero count is sent only for currently opened chats. There is no guarantee that it will be sent just after the count has changed 
  UpdateChatOnlineMemberCount
    { -- | Identifier of the chat 
      chat_id :: I53,
      -- | New number of online members in the chat, or 0 if unknown
      online_member_count :: I32
    }
  | -- | A notification was changed 
  UpdateNotification
    { -- | Unique notification group identifier 
      notification_group_id :: I32,
      -- | Changed notification
      notification :: Notification
    }
  | -- | A list of active notifications in a notification group has changed
  UpdateNotificationGroup
    { -- | Unique notification group identifier
      notification_group_id :: I32,
      -- | New type of the notification group
      type_2 :: NotificationGroupType,
      -- | Identifier of a chat to which all notifications in the group belong
      chat_id :: I53,
      -- | Chat identifier, which notification settings must be applied to the added notifications
      notification_settings_chat_id :: I53,
      -- | True, if the notifications should be shown without sound
      is_silent :: Bool,
      -- | Total number of unread notifications in the group, can be bigger than number of active notifications
      total_count :: I32,
      -- | List of added group notifications, sorted by notification ID 
      added_notifications :: [Notification],
      -- | Identifiers of removed group notifications, sorted by notification ID
      removed_notification_ids :: [I32]
    }
  | -- | Contains active notifications that was shown on previous application launches. This update is sent only if the message database is used. In that case it comes once before any updateNotification and updateNotificationGroup update 
  UpdateActiveNotifications
    { -- | Lists of active notification groups
      groups :: [NotificationGroup]
    }
  | -- | Describes whether there are some pending notification updates. Can be used to prevent application from killing, while there are some pending notifications
  UpdateHavePendingNotifications
    { -- | True, if there are some delayed notification updates, which will be sent soon
      have_delayed_notifications :: Bool,
      -- | True, if there can be some yet unreceived notifications, which are being fetched from the server
      have_unreceived_notifications :: Bool
    }
  | -- | Some messages were deleted 
  UpdateDeleteMessages
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Identifiers of the deleted messages
      message_ids :: [I53],
      -- | True, if the messages are permanently deleted by a user (as opposed to just becoming inaccessible)
      is_permanent :: Bool,
      -- | True, if the messages are deleted only from the cache and can possibly be retrieved again in the future
      from_cache :: Bool
    }
  | -- | User activity in the chat has changed 
  UpdateUserChatAction
    { -- | Chat identifier 
      chat_id :: I53,
      -- | Identifier of a user performing an action 
      user_id :: I32,
      -- | The action description
      action :: ChatAction
    }
  | -- | The user went online or offline 
  UpdateUserStatus
    { -- | User identifier 
      user_id :: I32,
      -- | New status of the user
      status :: UserStatus
    }
  | -- | Some data of a user has changed. This update is guaranteed to come before the user identifier is returned to the client 
  UpdateUser
    { -- | New data about the user
      user :: User
    }
  | -- | Some data of a basic group has changed. This update is guaranteed to come before the basic group identifier is returned to the client 
  UpdateBasicGroup
    { -- | New data about the group
      basic_group :: BasicGroup
    }
  | -- | Some data of a supergroup or a channel has changed. This update is guaranteed to come before the supergroup identifier is returned to the client 
  UpdateSupergroup
    { -- | New data about the supergroup
      supergroup :: Supergroup
    }
  | -- | Some data of a secret chat has changed. This update is guaranteed to come before the secret chat identifier is returned to the client 
  UpdateSecretChat
    { -- | New data about the secret chat
      secret_chat :: SecretChat
    }
  | -- | Some data from userFullInfo has been changed 
  UpdateUserFullInfo
    { -- | User identifier 
      user_id :: I32,
      -- | New full information about the user
      user_full_info :: UserFullInfo
    }
  | -- | Some data from basicGroupFullInfo has been changed 
  UpdateBasicGroupFullInfo
    { -- | Identifier of a basic group 
      basic_group_id :: I32,
      -- | New full information about the group
      basic_group_full_info :: BasicGroupFullInfo
    }
  | -- | Some data from supergroupFullInfo has been changed 
  UpdateSupergroupFullInfo
    { -- | Identifier of the supergroup or channel 
      supergroup_id :: I32,
      -- | New full information about the supergroup
      supergroup_full_info :: SupergroupFullInfo
    }
  | -- | Service notification from the server. Upon receiving this the client must show a popup with the content of the notification
  UpdateServiceNotification
    { -- | Notification type. If type begins with "AUTH_KEY_DROP_", then two buttons "Cancel" and "Log out" should be shown under notification; if user presses the second, all local data should be destroyed using Destroy method
      type_ :: T,
      -- | Notification content
      content :: MessageContent
    }
  | -- | Information about a file was updated 
  UpdateFile
    { -- | New data about the file
      file :: File
    }
  | -- | The file generation process needs to be started by the client
  UpdateFileGenerationStart
    { -- | Unique identifier for the generation process
      generation_id :: I64,
      -- | The path to a file from which a new file is generated; may be empty
      original_path :: T,
      -- | The path to a file that should be created and where the new file should be generated
      destination_path :: T,
      -- | String specifying the conversion applied to the original file. If conversion is "#url#" than original_path contains an HTTP/HTTPS URL of a file, which should be downloaded by the client
      conversion :: T
    }
  | -- | File generation is no longer needed 
  UpdateFileGenerationStop
    { -- | Unique identifier for the generation process
      generation_id :: I64
    }
  | -- | New call was created or information about a call was updated 
  UpdateCall
    { -- | New data about a call
      call :: Call
    }
  | -- | Some privacy setting rules have been changed 
  UpdateUserPrivacySettingRules
    { -- | The privacy setting 
      setting :: UserPrivacySetting,
      -- | New privacy rules
      rules :: UserPrivacySettingRules
    }
  | -- | Number of unread messages in a chat list has changed. This update is sent only if the message database is used 
  UpdateUnreadMessageCount
    { -- | The chat list with changed number of unread messages
      chat_list :: ChatList,
      -- | Total number of unread messages 
      unread_count :: I32,
      -- | Total number of unread messages in unmuted chats
      unread_unmuted_count :: I32
    }
  | -- | Number of unread chats, i.e. with unread messages or marked as unread, has changed. This update is sent only if the message database is used
  UpdateUnreadChatCount
    { -- | The chat list with changed number of unread messages
      chat_list :: ChatList,
      -- | Approximate total number of chats in the chat list
      total_count :: I32,
      -- | Total number of unread chats 
      unread_count :: I32,
      -- | Total number of unread unmuted chats
      unread_unmuted_count :: I32,
      -- | Total number of chats marked as unread 
      marked_as_unread_count :: I32,
      -- | Total number of unmuted chats marked as unread
      marked_as_unread_unmuted_count :: I32
    }
  | -- | An option changed its value 
  UpdateOption
    { -- | The option name 
      name :: T,
      -- | The new option value
      value :: OptionValue
    }
  | -- | A sticker set has changed 
  UpdateStickerSet
    { -- | The sticker set
      sticker_set :: StickerSet
    }
  | -- | The list of installed sticker sets was updated 
  UpdateInstalledStickerSets
    { -- | True, if the list of installed mask sticker sets was updated 
      is_masks :: Bool,
      -- | The new list of installed ordinary sticker sets
      sticker_set_ids :: [I64]
    }
  | -- | The list of trending sticker sets was updated or some of them were viewed 
  UpdateTrendingStickerSets
    { -- | The prefix of the list of trending sticker sets with the newest trending sticker sets
      sticker_sets :: StickerSets
    }
  | -- | The list of recently used stickers was updated 
  UpdateRecentStickers
    { -- | True, if the list of stickers attached to photo or video files was updated, otherwise the list of sent stickers is updated 
      is_attached :: Bool,
      -- | The new list of file identifiers of recently used stickers
      sticker_ids :: [I32]
    }
  | -- | The list of favorite stickers was updated 
  UpdateFavoriteStickers
    { -- | The new list of file identifiers of favorite stickers
      sticker_ids :: [I32]
    }
  | -- | The list of saved animations was updated 
  UpdateSavedAnimations
    { -- | The new list of file identifiers of saved animations
      animation_ids :: [I32]
    }
  | -- | The selected background has changed 
  UpdateSelectedBackground
    { -- | True, if background for dark theme has changed 
      for_dark_theme :: Bool,
      -- | The new selected background; may be null
      background :: Background
    }
  | -- | Some language pack strings have been updated 
  UpdateLanguagePackStrings
    { -- | Localization target to which the language pack belongs 
      localization_target :: T,
      -- | Identifier of the updated language pack 
      language_pack_id :: T,
      -- | List of changed language pack strings
      strings :: [LanguagePackString]
    }
  | -- | The connection state has changed 
  UpdateConnectionState
    { -- | The new connection state
      state :: ConnectionState
    }
  | -- | New terms of service must be accepted by the user. If the terms of service are declined, then the deleteAccount method should be called with the reason "Decline ToS update" 
  UpdateTermsOfService
    { -- | Identifier of the terms of service 
      terms_of_service_id :: T,
      -- | The new terms of service
      terms_of_service :: TermsOfService
    }
  | -- | The list of users nearby has changed. The update is sent only 60 seconds after a successful searchChatsNearby request 
  UpdateUsersNearby
    { -- | The new list of users nearby
      users_nearby :: [ChatNearby]
    }
  | -- | The list of supported dice emojis has changed 
  UpdateDiceEmojis
    { -- | The new list of supported dice emojis
      emojis :: [T]
    }
  | -- | A new incoming inline query; for bots only 
  UpdateNewInlineQuery
    { -- | Unique query identifier 
      id :: I64,
      -- | Identifier of the user who sent the query 
      sender_user_id :: I32,
      -- | User location, provided by the client; may be null
      user_location :: Location,
      -- | Text of the query 
      query :: T,
      -- | Offset of the first entry to return
      offset :: T
    }
  | -- | The user has chosen a result of an inline query; for bots only 
  UpdateNewChosenInlineResult
    { -- | Identifier of the user who sent the query 
      sender_user_id :: I32,
      -- | User location, provided by the client; may be null
      user_location :: Location,
      -- | Text of the query 
      query :: T,
      -- | Identifier of the chosen result 
      result_id :: T,
      -- | Identifier of the sent inline message, if known
      inline_message_id :: T
    }
  | -- | A new incoming callback query; for bots only 
  UpdateNewCallbackQuery
    { -- | Unique query identifier 
      id :: I64,
      -- | Identifier of the user who sent the query
      sender_user_id :: I32,
      -- | Identifier of the chat where the query was sent 
      chat_id :: I53,
      -- | Identifier of the message, from which the query originated
      message_id :: I53,
      -- | Identifier that uniquely corresponds to the chat to which the message was sent 
      chat_instance :: I64,
      -- | Query payload
      payload :: CallbackQueryPayload
    }
  | -- | A new incoming callback query from a message sent via a bot; for bots only 
  UpdateNewInlineCallbackQuery
    { -- | Unique query identifier 
      id :: I64,
      -- | Identifier of the user who sent the query 
      sender_user_id :: I32,
      -- | Identifier of the inline message, from which the query originated
      inline_message_id :: T,
      -- | An identifier uniquely corresponding to the chat a message was sent to 
      chat_instance :: I64,
      -- | Query payload
      payload :: CallbackQueryPayload
    }
  | -- | A new incoming shipping query; for bots only. Only for invoices with flexible price 
  UpdateNewShippingQuery
    { -- | Unique query identifier 
      id :: I64,
      -- | Identifier of the user who sent the query 
      sender_user_id :: I32,
      -- | Invoice payload 
      invoice_payload_2 :: T,
      -- | User shipping address
      shipping_address :: Address
    }
  | -- | A new incoming pre-checkout query; for bots only. Contains full information about a checkout 
  UpdateNewPreCheckoutQuery
    { -- | Unique query identifier 
      id :: I64,
      -- | Identifier of the user who sent the query 
      sender_user_id :: I32,
      -- | Currency for the product price 
      currency :: T,
      -- | Total price for the product, in the minimal quantity of the currency
      total_amount :: I53,
      -- | Invoice payload 
      invoice_payload :: ByteString64,
      -- | Identifier of a shipping option chosen by the user; may be empty if not applicable 
      shipping_option_id :: T,
      -- | Information about the order; may be null
      order_info :: OrderInfo
    }
  | -- | A new incoming event; for bots only 
  UpdateNewCustomEvent
    { -- | A JSON-serialized event
      event :: T
    }
  | -- | A new incoming query; for bots only 
  UpdateNewCustomQuery
    { -- | The query identifier 
      id :: I64,
      -- | JSON-serialized query data 
      data_ :: T,
      -- | Query timeout
      timeout :: I32
    }
  | -- | A poll was updated; for bots only 
  UpdatePoll
    { -- | New data about the poll
      poll :: Poll
    }
  | -- | A user changed the answer to a poll; for bots only 
  UpdatePollAnswer
    { -- | Unique poll identifier 
      poll_id :: I64,
      -- | The user, who changed the answer to the poll 
      user_id :: I32,
      -- | 0-based identifiers of answer options, chosen by the user
      option_ids :: [I32]
    }
  deriving (Show, Eq, Generic)
